import Link from 'next/link'
import macPic from '../public/macEwanpic.jpg'

const Index = () => (
    <div>
    <head>
        <title>MacEwan Book Trade</title>
        <img src={macPic}/>
    </head>
    <div>Welcome to Macewan book trade</div>
<Link href='/posts'>Go to posts</Link>
</div>

);

export default Index;
